import React from 'react';

const Row = (props) => {
    const {idx, name, popularity} = props
    return (
        <tr>
            <td>{idx}</td>
            <td>{name}</td>
            <td>{popularity}</td>
        </tr>
    );
}
const Table = (props) => {
    const {items} = props
    return(
        <table>
            <tbody>
                {items.map(row => 
                    <Row idx={row.idx}
                    name={row.name} 
                    popularity={row.popularity}/>
                )}
            </tbody>
        </table>
    )
}


const TopArtistsBoard = ({props}) => {
    return (
        <div>
            <h1 id="top_artists_table">Top Artists</h1>
            <table id="artists_table">
                <tbody>
                    <Table data = {props}/>

                </tbody>

            </table>

        </div>
    );
}

export default TopArtistsBoard;
